import './App.css';
import Form from './components/Form'
import Hola from './components/Hola'
import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link
} from 'react-router-dom'

function App() {
  return (
	  <Router>
		  <Link to="/" className="badge badge-primary mr-2">Principal</Link>
		  <Link to="/inicio" className="badge badge-secondary mr-2">Saludo</Link>
		  <Link to="/form" className="badge badge-success">Formulario</Link>
		  <Switch>
			  <Route exact path="/">
				  Principal
			  </Route>
			  <Route path="/inicio/:nombre">
				  <Hola nombre="Guillermo Morales" />
			  </Route>
			  <Route path="/form">
				  <Form />
			  </Route>
		  </Switch>
	  </Router>
  );
}

export default App;

